import React from 'react';
import '../App.css';

function About(){
    return (
        <section id="about" className="section-padding">
            <div className="container">
                <div className="row">
                    <div className="col-lg-6 col-md-6 col-xs-12 info">
                    </div>
                </div>
            </div>
        </section>

    )
}
export default About
